script: |
  super -f text -I q5430.spq | sort > q5430.out

inputs:
  - name: q5430.spq
    data: |
      SELECT DISTINCT 36 AS col1 FROM tab2 (FORMAT parquet) AS cor0 WHERE NULL IN ( + 24, - 87, - 70 + - col0 / 74 * - col0 * + col2 + col2 + - col1 / - 57 * + col1 );
  - name: tab2

outputs:
  - name: q5430.out
    data: |
